class Form extends Component{
    constructor(props)
    {
        super(props)

        this.state = {
            email: '',
            password: ''
        }
    }
    changed = (event)=>{
        let element = event.target.className;
        console.log(element);
    }
    render()
    {
        return(
            <form>
                <label>Email: </label>
                <input className="email" type="text" value={this.state.email} onChange={this.changed}></input>
                <label>Email: </label>
                <input type="text" value={this.state.password} onChange={this.changed}></input>
                {/* <button onclick={doitnow}>Submit</button> */}
            </form>
        )
    }
}
